import binascii

# Replace this with your actual hex string
hex_string = ("")

print(len(hex_string))

# Remove any whitespace or newlines
clean_hex = ''.join(hex_string.split())

# Convert hex string to binary data
try:
    binary_data = binascii.unhexlify(clean_hex)
except binascii.Error as e:
    print(f"Error converting hex to binary: {e}")
    exit(1)

# Write binary data to a JPEG file
with open("output_image.jpg", "wb") as image_file:
    image_file.write(binary_data)

print("Image saved as 'output_image.jpg'")
